def comb_sort(nums):
    if not nums:
        return nums

    gap = len(nums) // 10
    while gap > 1:
        for i in range(len(nums) - gap):
            if nums[i] > nums[i + gap]:
                nums[i], nums[i + gap] = nums[i + gap], nums[i]
        gap = int(gap / 1.25)

    # Perform a final bubble sort when gap is 1
    for i in range(len(nums) - 1):
        if nums[i] > nums[i + 1]:
            nums[i], nums[i + 1] = nums[i + 1], nums[i]

