def amicable_numbers_sum(limit):
    def sum_of_proper_divisors(n):
        if n == 0:
            return 0
        total = 1  # 1 is a proper divisor for all n > 1
        sqrt_n = int(n ** 0.5)
        for i in range(2, sqrt_n + 1):
            if n % i == 0:
                total += i
                other_divisor = n // i
                if other_divisor != i:
                    total += other_divisor
        return total

    total_sum = 0
    for num in range(2, limit + 1):
        sum_div = sum_of_proper_divisors(num)
        if sum_div > num and sum_div <= limit:
            # Check if the sum of proper divisors of sum_div is num
            if sum_of_proper_divisors(sum_div) == num:
                total_sum += num
    return total_sum

