def magic_square_test(my_matrix):
    # Check if matrix is square
    if not my_matrix or len(my_matrix) != len(my_matrix[0]):
        return False

    n = len(my_matrix)
    # Calculate the sum of the first row as reference
    target_sum = sum(my_matrix[0])

    # Check all rows
    for row in my_matrix:
        if sum(row) != target_sum:
            return False

    # Check all columns
    for col in range(n):
        column_sum = sum(my_matrix[row][col] for row in range(n))
        if column_sum != target_sum:
            return False

    # Check main diagonal
    diag1_sum = sum(my_matrix[i][i] for i in range(n))
    if diag1_sum != target_sum:
        return False

    # Check anti-diagonal
    diag2_sum = sum(my_matrix[i][n-1-i] for i in range(n))
    if diag2_sum != target_sum:
        return False

    return True

