def solution(a, b, n):
    import math
    gcd_ab = math.gcd(a, b)
    if n % gcd_ab != 0:
        return None
    # Find one solution using extended Euclidean algorithm
    def extended_gcd(a, b):
        if b == 0:
            return (a, 1, 0)
        else:
            g, x, y = extended_gcd(b, a % b)
            return (g, y, x - (a // b) * y)

    g, x_eg, y_eg = extended_gcd(a, b)
    # Scale the solution to match n
    x = (x_eg * (n // g))
    y = (y_eg * (n // g))
    # Return in the required format
    return ('x = ', x, ', y = ', y)

