    k = int(n**0.5)
    if k * k != n:
        return False
    # Check if k is 1 or a prime
    if k == 1:
        return False
    # Check if k is a prime
    def is_prime(k):
        if k <= 1:
            return False
        if k == 2:
            return True
        if k % 2 == 0:
            return False
        for i in range(3, int(k**0.5) + 1, 2):
            if k % i == 0:
                return False
        return True
    return not is_prime(k)

