def max_sub_array_sum_repeated(a, n, k):
    def kadane(arr):
        max_current = max_global = arr[0]
        for num in arr[1:]:
            max_current = max(num, max_current + num)
            max_global = max(max_global, max_current)
        return max_global

    if not a:
        return 0

    max_subarray_single = kadane(a)
    total_sum = sum(a)

    max_prefix = a[0]
    current = a[0]
    for i in range(1, n):
        current = max(a[i], current + a[i])
        max_prefix = max(max_prefix, current)

    max_suffix = a[-1]
    current = a[-1]
    for i in range(n-2, -1, -1):
        current = max(a[i], current + a[i])
        max_suffix = max(max_suffix, current)

    if k == 1:
        return max_subarray_single
    elif total_sum > 0:
        return max(max_subarray_single, max_prefix + max_suffix + (k-2)*total_sum)
