def get_Inv_Count(arr, n):
    def merge_sort(arr, temp, left, right):
        inv_count = 0
        if left >= right:
            return 0
        mid = (left + right) // 2
        inv_count += merge_sort(arr, temp, left, mid)
        inv_count += merge_sort(arr, temp, mid + 1, right)
        i = left
        j = mid + 1
        k = left
        while i <= mid and j <= right:
            if arr[i] <= arr[j]:
                temp[k] = arr[i]
                i += 1
            else:
                temp[k] = arr[j]
                inv_count += (mid - i + 1)
                j += 1
            k += 1
        while i <= mid:
            temp[k] = arr[i]
            i += 1
            k += 1
        while j <= right:
            temp[k] = arr[j]
            j += 1
            k += 1
        for m in range(left, right + 1):
            arr[m] = temp[m]
        return inv_count

    temp = [0] * n
    return merge_sort(arr, temp, 0, n - 1)

