import heapq

def find_smallest_range(list_of_lists):
    if not list_of_lists or any(not arr for arr in list_of_lists):
        return (-1, -1)

    min_heap = []
    max_val = -float('inf')
    pointers = [0] * len(list_of_lists)
    min_range = (-1, -1)

    # Initialize the heap with the first element of each array
    for i in range(len(list_of_lists)):
        if list_of_lists[i]:
            heapq.heappush(min_heap, (list_of_lists[i][0], i, 0))
            max_val = max(max_val, list_of_lists[i][0])

    while True:
        # Check if any array is exhausted
        if any(pointers[i] >= len(list_of_lists[i]) for i in range(len(list_of_lists))):
            break

        # Get the current minimum element
        current_min, array_idx, pointer_idx = heapq.heappop(min_heap)

        # Update the min_range if needed
        current_range = (current_min, max_val)
        if min_range == (-1, -1) or (current_range[1] - current_range[0] < min_range[1] - min_range[0]):
            min_range = current_range

        # Move the pointer in the array that had the current_min
        pointers[array_idx] += 1
        if pointers[array_idx] < len(list_of_lists[array_idx]):
            next_val = list_of_lists[array_idx][pointers[array_idx]]
            heapq.heappush(min_heap, (next_val, array_idx, pointers[array_idx]))
            max_val = max(max_val, next_val)
        else:
            # This array is exhausted, so we can't proceed further
            break

    return min_range

