    for j in range(n):
        dp[0][j] = dp[0][j-1] + gold[0][j] if j > 0 else gold[0][j]
    # Initialize the first column
    for i in range(1, m):
        dp[i][0] = dp[i-1][0] + gold[i][0]
    # Fill the rest of the DP table
    for i in range(1, m):
        for j in range(1, n):
