def max_profit(price, k):
    if not price or k == 0:
        return 0
    n = len(price)
    if k >= n // 2:
        # Greedy approach for unlimited transactions
        max_profit = 0
        for i in range(1, n):
            if price[i] > price[i-1]:
                max_profit += price[i] - price[i-1]
        return max_profit
    # Dynamic programming approach
    dp = [[0] * (n + 1) for _ in range(k + 1)]
    for i in range(1, k + 1):
        min_price = price[0]
        for j in range(1, n):
            min_price = min(min_price, price[j])
            dp[i][j] = max(dp[i][j-1], price[j] - min_price + dp[i-1][j-1])
    return dp[k][n-1]

