def first_Factorial_Divisible_Number(x):
    if x == 1:
        return 1
    factors = {}
    temp = x
    i = 2
    while i * i <= temp:
        while temp % i == 0:
            factors[i] = factors.get(i, 0) + 1
            temp //= i
        i += 1
    if temp > 1:
        factors[temp] = factors.get(temp, 0) + 1
    max_n = 0
    for p, e in factors.items():
        low = 1
        high = e * p
        while low < high:
            mid = (low + high) // 2
            total = 0
            power = p
            while power <= mid:
                total += mid // power
                power *= p
            if total >= e:
                high = mid
            else:
                low = mid + 1
        max_n = max(max_n, low)
    return max_n

